            Id = spotifyAlbumDto.Id,
            Images = spotifyAlbumDto.Images.Select(spotifyAlbumDtoImage => new ClassImage()
            {
                Height = spotifyAlbumDtoImage.Height,
                Url = spotifyAlbumDtoImage.Url,
                Width = spotifyAlbumDtoImage.Width
