            Name = spotifyAlbumDto.Name,
            Popularity = spotifyAlbumDto.Popularity,
            ReleaseDate = spotifyAlbumDto.ReleaseDate,
            ReleaseDatePrecision = spotifyAlbumDto.ReleaseDatePrecision,
            Tracks = new ClassTracks()
            {
